import react from 'react';


const Form = () => {
    return (
        <form>
            <label className='title'>
                <h3>
                Basic Form Functionality
                </h3>
                </label> <br />
            <label for='name' >Name</label>
            <input id='name' type='text' required placeholder='Enter Name...'></input>
        </form>
        );
};

export default Form;
